import React from 'react';
import styled from 'styled-components';
import Button from '@material-ui/core/Button';

const Nav = styled.div`
    width: 100vw;
    height: 40px;
    background: white;
    border-bottom: 2px solid #707070;
    position: absolute;
    margin-top: 0;
`;

const Navbar = () => {
    return (
        <Nav>
            <Button>Button</Button>
        </Nav>
    );
};

export default Navbar;
